{
  "$schema": "https://biomejs.dev/schemas/1.9.4/schema.json",
  "vcs": { "enabled": false, "clientKind": "git", "useIgnoreFile": false },
  "files": { "ignoreUnknown": false, "ignore": ["**/dist/**"] },
  "formatter": {
    "enabled": true,
    "useEditorconfig": true,
    "formatWithErrors": false,
    "indentStyle": "tab",
    "indentWidth": 2,
    "lineEnding": "lf",
    "lineWidth": 100,
    "attributePosition": "auto",
    "bracketSpacing": true,
    "ignore": [".github/workflows/**/*.yml", ".changeset/**/*.md", "**/pnpm-lock.yaml"]
  },
  "organizeImports": { "enabled": true },
  "linter": {
    "enabled": true,
    "rules": { "recommended": true, "suspicious": { "noExplicitAny": "off" } }
  },
  "javascript": {
    "formatter": {
      "jsxQuoteStyle": "double",
      "quoteProperties": "asNeeded",
      "trailingCommas": "es5",
      "semicolons": "always",
      "arrowParentheses": "always",
      "bracketSameLine": false,
      "quoteStyle": "single",
      "attributePosition": "auto",
      "bracketSpacing": true
    }
  },
  "overrides": [
    {
      "include": ["*.json", "*.toml", "*.yml"],
      "formatter": { "indentStyle": "space" }
    }
  ]
}

import { definePreset } from 'unbuild';

// @see https://github.com/unjs/unbuild
export default definePreset({
	clean: true,
	declaration: true,
	sourcemap: true,
	rollup: {
		emitCJS: true,
		inlineDependencies: true,
		esbuild: {
			minify: true,
		},
	},
});

lockfileVersion: '9.0'

settings:
  autoInstallPeers: false
  excludeLinksFromLockfile: false

importers:

  .:
    devDependencies:
      '@biomejs/biome':
        specifier: 1.9.4
        version: 1.9.4
      '@changesets/cli':
        specifier: ^2.26.2
        version: 2.26.2
      '@types/node':
        specifier: ^18.16.0
        version: 18.16.0
      typescript:
        specifier: ^5.2.2
        version: 5.2.2
      unbuild:
        specifier: ^2.0.0
        version: 2.0.0(typescript@5.2.2)

  examples/basic:
    dependencies:
      '@clack/core':
        specifier: workspace:*
        version: link:../../packages/core
      '@clack/prompts':
        specifier: workspace:*
        version: link:../../packages/prompts
      picocolors:
        specifier: ^1.0.0
        version: 1.0.0
    devDependencies:
      jiti:
        specifier: ^1.17.0
        version: 1.17.0

  examples/changesets:
    dependencies:
      '@clack/core':
        specifier: workspace:*
        version: link:../../packages/core
      '@clack/prompts':
        specifier: workspace:*
        version: link:../../packages/prompts
      picocolors:
        specifier: ^1.0.0
        version: 1.0.0
    devDependencies:
      jiti:
        specifier: ^1.17.0
        version: 1.17.0

  packages/core:
    dependencies:
      picocolors:
        specifier: ^1.0.0
        version: 1.0.0
      sisteransi:
        specifier: ^1.0.5
        version: 1.0.5
    devDependencies:
      vitest:
        specifier: ^1.6.0
        version: 1.6.0(@types/node@18.16.0)
      wrap-ansi:
        specifier: ^8.1.0
        version: 8.1.0

  packages/prompts:
    dependencies:
      '@clack/core':
        specifier: workspace:*
        version: link:../core
      picocolors:
        specifier: ^1.0.0
        version: 1.0.0
      sisteransi:
        specifier: ^1.0.5
        version: 1.0.5
    devDependencies:
      is-unicode-supported:
        specifier: ^1.3.0
        version: 1.3.0

